*{
	margin:0;
	padding: 0;
}
body{
	height: 100vh;
	display: flex;
	align-items: center;
	justify-content:center;
}

.container{
	width: 100%;
	display: flex;
	align-items: center;
	justify-content: center;
}

.playButton{
	font-size: 40px;
	border:3px solid black;
	border-radius: 5px;
	height: 60px;
	width: 60px;
	padding: 10px;
	margin: 10px;
	display: flex;
	flex-direction: column;
	align-items: center;
	justify-content: center;
	cursor:pointer;
	transition: 0.3s all;
}

.sound{
	font-size: 15px;
}
.playing{
	transform: scale(1.3);
	background-color: black;
	color: white;
}
